  `us_tel` varchar(30) NOT NULL,
  `us_pp` varchar(30) NOT NULL,
  `pass_wor` varchar(35) NOT NULL,
  `bh_code` varchar(20) NOT NULL,
  `us_created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `us_des` int(4) NOT NULL,
  `us_frz` int(2) NOT NULL DEFAULT '0',
  PRIMARY KEY (`sr_no`)
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8;


-- Table `vw_fc_transaction` --
CREATE ALGORITHM=UNDEFINED DEFINER=`calcus`@`localhost` SQL SECURITY DEFINER VIEW `vw_fc_transaction` AS select `transaction`.`sale_pur` AS `tr_type`,`transaction`.`to_cy` AS `fc_cy`,`transaction`.`bh_code` AS `bh_code`,`transaction`.`trans_date` AS `trans_date`,(`transaction`.`to_amt` * -(1)) AS `OMR_amt`,(`transaction`.`frm_amt` * -(1)) AS `FC_Amt` from `transaction` where (`transaction`.`sale_pur` = 1) union all select `transaction`.`sale_pur` AS `tr_type`,`transaction`.`from_cy` AS `fc_cy`,`transaction`.`bh_code` AS `bh_code`,`transaction`.`trans_date` AS `trans_date`,`transaction`.`to_amt` AS `OMR_Amt`,`transaction`.`frm_amt` AS `FC_Amt` from `transaction` where (`transaction`.`sale_pur` = 0);



